    def CalENG(self):
        #print('1')
        inCET4 = self.CET4.text()
        inCET6 = self.CET6.text()

        check_box1_status = self.CBOX92.isChecked()
        check_box2_status = self.CBOXsyl.isChecked()
        check_box3_status = self.CBOXyb.isChecked()
        check_box4_status = self.CBOXbk.isChecked()
        check_box5_status = self.CBOXzk.isChecked()
        if(check_box1_status == True):level = 5
        elif(check_box2_status == True):level = 4
        elif(check_box3_status == True):level = 3
        elif(check_box4_status == True):level = 2
        elif(check_box5_status == True):level = 1
        else:level = 0

        dfPGE = pd.read_csv("/Users/reeno/Documents/Achievement_Analysis/Score/WPGE_Ver1.32.csv", sep =",")
        from PGE_Model import Linear_Regression
        if(int(inCET4) >= 220 and int(inCET4) <= 750 and int(inCET6) >= 220 and int(inCET6) <= 750 and level != 0):
                score = Linear_Regression.Linear_Regression(dfPGE,'PGE',inCET4,inCET6,level)
                self.label_5.setText('预测结果为'+score[1:5]+'分')
        elif(int(inCET4) < 220 or int(inCET4) > 750):
                self.label_5.setText('请输入正确的四级分数')
        elif(int(inCET6) < 220 or int(inCET6) > 750):
                self.label_5.setText('请输入正确的六级分数')
        else:
                self.label_5.setText('请选择院校')
    def PGEP(self):
        #输入框
        inCET4 = self.CET4_2.text()
        inCET6 = self.CET6_2.text()
