        inmath = self.math.text()
        ineng = self.eng.text()
        incl = self.cl.text()
        insl = self.sl.text()
        ingpa = self.gpa.text()
        DV2CL = int(inscore) - int(incl)
        DV2SL = int(inscore) - int(insl)

        #考研本科
        check_box1_status = self.bk92.isChecked()
        check_box2_status = self.bksyl.isChecked()
